window["app-templates"]["../client/features/templates/extracurricular.help.html"] = "<p>Colleges want well-rounded applicants. Clubs, sports teams, instruments you play, volunteer activities, after-school jobs – those all count.</p>"; 

window["app-templates"]["../client/features/templates/extracurricular.help_es.html"] = "<p>Las universidades quieren estudiantes redondeados. Los clubes, equipos de deporte, instrumentos musicales, actividades de voluntariados y trabajos trabajos fuera del horario escolar: todos cuentan.</p>"; 

