window["app-templates"]["../client/features/templates/general.help.html"] = "<div class=\"copy-scroll\"><h3>BROUGHT TO YOU BY</h3><p><a class=\"show-a-tag noPad\" target=\"_blank\" href=\"https://www.ngpf.org/\">Next Gen Personal Finance</a>, whose mission is to revolutionize the teaching of personal finance in all schools and to improve the financial lives of the next generation of Americans.</p><h3>GENERAL</h3><p>PAYBACK is designed to get you thinking about how to succeed in college without taking on too much student loan debt. It's not a step-by-step guide to managing your finances in college. Everyone's situation is different and no game can capture all the possibilities. Hopefully, this game will bring up some questions and ideas you hadn’t considered before. Use those thoughts to continue the conversation with your counselors, teachers, and parents.</p><p>Some resources for a deeper dive into the topic of paying for college:<br><a class=\"show-a-tag\" href=\"https://www.hsfpp.org/blog/article/59/prioritizing-options-to-pay-for-college-infographic.aspx\" target=\"_blank\">How do people pay for college?</a><br><a class=\"show-a-tag\" href=\"https://www.nytimes.com/2017/04/06/education/edlife/6-reasons-you-may-not-graduate-on-time.html?_r=0\" target=\"_blank\">Why students drop out of college</a><br><a class=\"show-a-tag\" href=\"https://www.usnews.com/education/best-colleges/paying-for-college/articles/2015/04/13/infographic-map-out-your-financial-aid-award-letter\" target=\"_blank\">How to evaluate a financial aid award letter</a><br><a class=\"show-a-tag\" href=\"https://docs.google.com/document/d/18rbGkGei-fkY9MjYffCQLLeo9SwhGXuf_JYipG48Llk/edit\" target=\"_blank\">Estimate your loan payments</a><br></p><h3>OUR SOURCES</h3><p>College costs were determined using sample FAFSA details found <a class=\"show-a-tag noPad\" href=\"http://oregongoestocollege.org/sites/default/files/itsaplan/samplesar.pdf\" target=\"_blank\">here</a>. We used the same income and family data in net price calculators for two private four-year colleges and a public four-year university in each state, both as an in-state and out-of-state student. Community college costs were calculated using the average found <a class=\"show-a-tag noPad\" href=\"https://bigfuture.collegeboard.org/pay-for-college/college-costs/college-costs-faqs\" target=\"_blank\">here</a>. The cost shown assumes a student will live at home. But everyone's financial situation is different and even living with family has costs.</p><p><strong>Majors:</strong> <a class=\"show-a-tag\" href=\"https://nces.ed.gov/programs/digest/d16/tables/dt16_322.10.asp?current=yes\" target=\"_blank\">NCES</a> <a class=\"show-a-tag\" href=\"http://www.myplan.com/majors/top-ten/associates-degrees.php\" target=\"_blank\">MyPlan</a></p><p><strong>Starting Salaries:</strong> <a class=\"show-a-tag\" target=\"_blank\" href=\"http://www.naceweb.org/job-market/graduate-outcomes/first-destination/class-of-2015/\">naceweb</a> <a class=\"show-a-tag\" target=\"_blank\" href=\"http://www.payscale.com/college-salary-report/majors-that-pay-you-back/associate\">PayScale</a></p><h3>FOR TEACHERS</h3><p>To get the most out of playing PAYBACK with your students, have them fill out <a class=\"show-a-tag noPad\" target=\"_blank\" href=\"https://docs.google.com/document/d/16QmPb12BEeV8VrfDLwMMPsuJSehcpOqbcHj5PUaR9wc/edit?usp=sharing\">our companion worksheet</a> as they play the game.</p></div>"; 

window["app-templates"]["../client/features/templates/general.help_es.html"] = "<div class=\"copy-scroll\"><h3>PRESENTADO POR</h3><p><a class=\"show-a-tag noPad\" target=\"_blank\" href=\"https://www.ngpf.org/\">Next Gen Personal Finance</a>, quién tiene la misión de cambiar la educación de finanzas personales en las universidades para poder mejorar las vidas financieras de la próxima generación de estadounidenses.</p><h3>GENERAL</h3><p>\"PAYBACK está diseñado para hacerle pensar en cómo tener éxito en la universidad sin tener tantas deudas de préstamos de estudiantes. No es una guía de paso por paso para administrar sus finanzas en la universidad. Cada situación de cada individuo es diferente y ningún juego capta todas las posibilidades. Ojalá que este juego ayude a que le surjan preguntas e ideas que no había considerado antes. Puede usar esos pensamientos para continuar la conversación con sus consejeros, profesores y padres.\"</p><p>Algunos recursos para investigar más a fondo el tema de cómo pagar la universidad:<br><a class=\"show-a-tag\" href=\"https://www.hsfpp.org/blog/article/59/prioritizing-options-to-pay-for-college-infographic.aspx\" target=\"_blank\">¿Cómo paga la gente la universidad?</a><br><a class=\"show-a-tag\" href=\"https://www.nytimes.com/2017/04/06/education/edlife/6-reasons-you-may-not-graduate-on-time.html?_r=0\" target=\"_blank\">Por qué los estudiantes se dan de baja de la universidad</a><br><a class=\"show-a-tag\" href=\"https://www.usnews.com/education/best-colleges/paying-for-college/articles/2015/04/13/infographic-map-out-your-financial-aid-award-letter\" target=\"_blank\">Cómo evaluar una carta de otorgamiento de ayuda financiera</a><br><a class=\"show-a-tag\" href=\"https://docs.google.com/document/d/18rbGkGei-fkY9MjYffCQLLeo9SwhGXuf_JYipG48Llk/edit\" target=\"_blank\">Calcular los pagos de préstamos universitarios</a><br></p><h3>NUESTRAS FUENTES</h3><p>\"Los gastos de universidad se calcularon usando los detalles de la ayuda federal (FAFSA) que se presentan <a class=\"show-a-tag noPad\" href=\"http://oregongoestocollege.org/sites/default/files/itsaplan/samplesar.pdf\" target=\"_blank\">aquí</a>. Usamos el mismo salario e información de la familia en las calculadoras del precio neto para dos universidades privadas de cuatro años y una universidad pública en cada estado, con una matrícula de residentes y una de no residentes. en cada estado, con una matrícula de residentes y una de no residentes. Los gastos del colegio comunitario se calcularon usando el promedio encontrado <a class=\"show-a-tag noPad\" href=\"https://bigfuture.collegeboard.org/pay-for-college/college-costs/college-costs-faqs\" target=\"_blank\">aquí</a>. Los gastos que se muestran suponen que el estudiante vive en la casa de su familia. Pero la situación financiera de cada uno es diferente y aún si vive con su familia también puede tener gastos.\"</p><p><strong>Especializaciones:</strong> <a class=\"show-a-tag\" href=\"https://nces.ed.gov/programs/digest/d16/tables/dt16_322.10.asp?current=yes\" target=\"_blank\">NCES</a> <a class=\"show-a-tag\" href=\"http://www.myplan.com/majors/top-ten/associates-degrees.php\" target=\"_blank\">MyPlan</a></p><p><strong>Salarios iniciales:</strong> <a class=\"show-a-tag\" target=\"_blank\" href=\"http://www.naceweb.org/job-market/graduate-outcomes/first-destination/class-of-2015/\">naceweb</a> <a class=\"show-a-tag\" target=\"_blank\" href=\"http://www.payscale.com/college-salary-report/majors-that-pay-you-back/associate\">PayScale</a></p><h3>PARA MAESTROS</h3><p>Para sacar lo máximo de PAYBACK con los estudiantes, pueden rellenar nuestra hoja <a class=\"show-a-tag noPad\" target=\"_blank\" href=\"https://docs.google.com/document/d/16QmPb12BEeV8VrfDLwMMPsuJSehcpOqbcHj5PUaR9wc/edit?usp=sharing\">de cálculo complementaria</a> mientras jueguen al juego.</p></div>"; 

