window["app-templates"]["../client/features/templates/schools.help.html"] = "<div class=\"copy-scroll\"><h3>Prestige</h3><p>A higher-prestige school is harder to get into, but can offer more aid as well. High-prestige schools also have a more powerful network of alumni. But, in general, the name of your school has much less to do with your success than what you do while you’re there.</p><h3>Aid</h3><p>In this game, we are defining aid as any money you don't have to pay back. That includes money from grants, scholarships and help from your parents. Actual financial aid awards usually consist of scholarships, grants and loans, with you and your family expected to contribute the difference.</p><p>Your actual aid package will vary based on your family's financial information, your state of residence and the schools to which you're applying. Every school has a <a class=\"show-a-tag\" href=\"https://collegecost.ed.gov/netpricecenter.aspx\" target=\"_blank\">net price calculator</a> that can estimate what aid you might be eligible for.</p><p>Remember: Loans aren’t always a bad thing. In fact, <a class=\"show-a-tag\" href=\"https://ticas.org/content/pub/average-student-debt-graduation-4-30100-class-2015\" target=\"_blank\">68% of college students graduate with an average of $30,100 in loans</a>. As long as you borrow carefully, you’ll be fine.</p></div>"; 

window["app-templates"]["../client/features/templates/schools.help_es.html"] = "<div class=\"copy-scroll\"><h3>Prestigio</h3><p>Es más difícil ser aceptado a una universidad de mayor prestigio, pero puede ofrecer más asistencia financiera también. Las universidades con más prestigio también tienen una red más potente de ex-alumnos. Pero, en general, el nombre de su universidad tiene menos que ver con el éxito que tiene usted que lo que hace mientras asiste.</p><h3>Ayuda financiera</h3><p>En este juego, la ayuda financiera es el dinero que recibe que no tiene que devolver. Incluye el dinero de subvenciones, becas y la ayuda que reciba de sus padres. Las concesiones actuales de ayuda financiera otorgada incluyen becas, subvenciones y préstamos, con la idea de que usted y su familia pagan la diferencia.</p><p>Lo que recibe en ayuda financiera se basará en la información financiera de su familia, el estado de su residencia y la universidad donde solicita. Cada universidad tiene una <a class=\"show-a-tag\" href=\"https://collegecost.ed.gov/netpricecenter.aspx\" target=\"_blank\">calculadora del precio neto</a> que puede calcular un estimado de la ayuda financiera a la que es elegible.</p><p>Recuerde: Los préstamos no siempre son algo malo. Es más, <a class=\"show-a-tag\" href=\"https://ticas.org/content/pub/average-student-debt-graduation-4-30100-class-2015\" target=\"_blank\">el 68% de los estudiantes universitarios se gradúan con un promedio de $30,100 en deudas universitarias</a>. Siempre y cuando pida prestado con cautela, le va a ir bien.</p></div>"; 

